// Booking.js
import React from 'react';

function Booking() {
  return (
    <section className="py-16 bg-gray-100">
      <div className="container mx-auto">
        <h2 className="text-3xl font-bold mb-4">Booking</h2>
      </div>
    </section>
  );
}

export default Booking;
